import React from "react";
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableFooter from '@material-ui/core/TableFooter';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import TablePagination from '@material-ui/core/TablePagination';

import { find } from '../../redux/client/client.actions';

const columns = [
  {
    Header: "Nome",
    accessor: "name"
  },
  {
    Header: "E-mail",
    accessor: "email"
  },
  {
    Header: "Data de Nascimento",
    accessor: "birthDate"
  },
  {
    Header: "Sexo",
    accessor: "gender"
  },
  {
    Header: "Celular",
    accessor: "phone"
  },
  {
    Header: "Endereço",
    accessor: "address"
  }
];

class Clientes extends React.Component {
  constructor({ props }) {
    super(props);
  }

  componentWillMount() {
    console.log("Entrou no didmount, props:", this.props);

    const { dispatch } = this.props;

    dispatch(find());
  }

  render() {
    const { data } = this.props;
    return (
      <div className="Clientes">
        <div className="form">

        </div>

        <TableContainer component={Paper}>
          <Table className='table'>
            <TableHead>
              <TableRow>
                <TableCell>Nome</TableCell>
                <TableCell>E-mail</TableCell>
                <TableCell>Data de Nascimento</TableCell>
                <TableCell>Sexo</TableCell>
                <TableCell>Celular</TableCell>
                <TableCell>Endereço</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {data.map((row) => (
                <TableRow key={row.id}>
                  <TableCell component="th" scope="row">
                    {row.name}
                  </TableCell>
                  <TableCell>{row.email}</TableCell>
                  <TableCell>{row.birthDate}</TableCell>
                  <TableCell>{row.gender}</TableCell>
                  <TableCell>{row.phone}</TableCell>
                  <TableCell>{row.address}</TableCell>
                </TableRow>
              ))}
            </TableBody>
            <TableFooter>
              <TableRow>
                <TablePagination
                  rowsPerPageOptions={[5, 10, 25, 50]}
                  colSpan={3}
                  count={data.length}
                  rowsPerPage={10}
                  page={0}
                  SelectProps={{
                    inputProps: { 'aria-label': 'registros por página' },
                    native: true,
                  }}
                />
              </TableRow>
            </TableFooter>
          </Table>
        </TableContainer>
      </div>
    );
  }
}


const mapStateToProps = (state) => {
  return {
    data: state.client.data
  };
}
const connectedClientsPage = withRouter(connect(mapStateToProps, null, null, {
  pure: false
})(Clientes));

export { connectedClientsPage as Clientes };
